// import './App.css';
import React, { useState } from 'react';
import "date-fns"
import '@fontsource/roboto';
import Grid from '@material-ui/core/Grid';
// import MomentUtils from '@date-io/moment'
import DateFnsUtils from '@date-io/date-fns'; // choose your lib
import {Select, MenuItem} from '@material-ui/core'
import {
  DatePicker,
  MuiPickersUtilsProvider,
  KeyboardDatePicker
} from '@material-ui/pickers';

function App() {
  const [selectedStartDate, handleDateStartChange] = useState(new Date());
  const [selectedEndDate, handleDateEndChange] = useState(new Date());
  return (
    <div className="App">
      <h1>
        MM802 mini project, test
      </h1>
      <MuiPickersUtilsProvider utils={DateFnsUtils}>
        <KeyboardDatePicker
          clearable
          value={selectedStartDate}
          placeholder="10/10/2020"
          onChange={date => handleDateStartChange(date)}
          maxDate={new Date()}
          format="MM/dd/yyyy"
        />

        <KeyboardDatePicker
          clearable
          value={selectedEndDate}
          // placeholder="10/10/2020"
          onChange={date => handleDateEndChange(date)}
          maxDate={new Date()}
          format="MM/dd/yyyy"
        />      
      </MuiPickersUtilsProvider>
    </div>
  );
}

export default App;
